import "bootstrap/dist/css/bootstrap.min.css";
import { Button } from "react-bootstrap";
import "./NavBarDesktop.css";
import  React, {useState} from 'react';
const NavBarDesktop = () => {
  const [isOpen, setIsOpen] = useState(false);

  const toggleNavbar = () => {
    setIsOpen(!isOpen);
  };
  return (
    <div className="nav-bar-desktop">
      <div className="logo">
        <div className="logodefault2">
          <div className="logodefault-inner" />
          <img className="logosaas-icon2" alt="" src="/logosaas@2x.png" />
        </div>
        <div className="made-by1">made by</div>
        <img
          className="black-horizontal-1-icon1"
          alt=""
          src="/blackhorizontal-1.svg"
        />
         {/* <button className="navbar-toggle" onClick={toggleNavbar}>
          <span className="navbar-toggle-icon">&#9776;</span>
        </button> */}
      </div>
      {/* <div className={'stack4 ${isOpen ? "active" : ""}'}></div> */}
      <div className="stack4">
        <label className="about1">About</label>
        <label className="about1">Features</label>
        <label className="about1">Customers</label>
        <label className="about1">Updates</label>
        <label className="about1">Help</label>
        <Button variant="outline-primary">Get for free</Button>
      </div>
    </div>
  );
};

export default NavBarDesktop;
